import React from "react";

// Navbar Component
function Navbar() {
    return (
        <nav style={styles.navbar}>
            <div style={styles.navLogo}>Suivi Patient</div>
            <ul style={styles.navLinks}>
                <li><a href="#home" style={styles.navLink}>Home</a></li>
                <li><a href="#services" style={styles.navLink}>Services</a></li>
                <li><a href="#notifications" style={styles.navLink}>Notification</a></li>
                <li><a href="#appointments" style={styles.navLink}>Rendez-vous</a></li>
                <li><a href="#login" style={styles.navLink}>Login</a></li>
                <li><a href="#signup" style={styles.navLink}>Sign Up</a></li>
            </ul>
        </nav>
    );
}

// Footer Component
function Footer() {
    return (
        <footer style={styles.footer}>
            <p>© 2024 Suivi Patient App. Tous droits réservés.</p>
            <p>Contactez-nous : contact@suivipatient.com</p>
        </footer>
    );
}

// HomePage Component
function HomePage() {
    return (
        <div>
            {/* Navbar */}
            <Navbar />

            {/* Main Sections */}
            <section id="home" style={styles.section}>
                <div style={styles.contentWrapper}>
                    <img 
                        src="/image/welcome-background.webp" 
                        alt="Welcome Background" 
                        style={styles.welcomeImage}
                    />
                    <div>
                        <h1 style={styles.sectionTitle}>Bienvenue sur Suivi Patient</h1>
                        <p style={styles.sectionText}>Gérez facilement vos données de santé et vos rendez-vous.</p>
                    </div>
                </div>
            </section>

            <section id="services" style={styles.section}>
                <h2 style={styles.sectionTitle}>Nos Services</h2>
                <ul style={styles.list}>
                    <li>Gestion des patients</li>
                    <li>Suivi des données de santé</li>
                    <li>Rappel de rendez-vous</li>
                    <li>Notifications en temps réel</li>
                </ul>
            </section>

            <section id="notifications" style={styles.section}>
                <h2 style={styles.sectionTitle}>Notifications</h2>
                <p style={styles.sectionText}>Recevez des notifications importantes sur vos rendez-vous et vos données de santé.</p>
            </section>

            <section id="appointments" style={styles.section}>
                <h2 style={styles.sectionTitle}>Rendez-vous</h2>
                <p style={styles.sectionText}>Planifiez et suivez vos rendez-vous médicaux en quelques clics.</p>
            </section>

            {/* Footer */}
            <Footer />
        </div>
    );
}

// Styles
const styles = {
    navbar: {
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: "10px 20px",
        backgroundColor: "#007bff",
        color: "white",
        position: "sticky",
        top: 0,
        zIndex: 1000,
    },
    navLogo: {
        fontSize: "24px",
        fontWeight: "bold",
    },
    navLinks: {
        listStyle: "none",
        display: "flex",
        gap: "15px",
        margin: 0,
        padding: 0,
    },
    navLink: {
        textDecoration: "none",
        color: "white",
        fontSize: "16px",
    },
    section: {
        padding: "20px",
        textAlign: "center",
        borderBottom: "1px solid #ddd",
        backgroundColor: "#f9f9f9",
    },
    contentWrapper: {
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        flexWrap: "wrap",
        gap: "20px",
        maxWidth: "600px",
        margin: "0 auto",
    },
    welcomeImage: {
        width: "150px",
        height: "150px",
        objectFit: "cover",
        borderRadius: "10px",
    },
    sectionTitle: {
        fontSize: "20px",
        margin: "10px 0",
        color: "#333",
    },
    sectionText: {
        fontSize: "16px",
        color: "#555",
    },
    list: {
        listStyle: "none",
        padding: 0,
        fontSize: "18px",
        color: "#555",
    },
    footer: {
        backgroundColor: "#007bff",
        textAlign: "center",
        color: "white",
        padding: "20px",
        marginTop: "20px",
    },
};

export default HomePage;
